import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      plants: []
    };
  }

  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(response =>
        response.json())
      .then(users => this.setState({ plants: users}))
  }


  render() {
    return (
      <div className="App">
        {this.state.plants.map (
          plant => (
            <h1 key = {plant.id}>{plant.name}</h1>
          )
        )
      }
      </div>
    );
  }
}

export default App;
